import React from 'react';
import styled from 'styled-components';

// Styles avec styled-components
const Container = styled.div`
  z-index: 3;
  position: absolute;
  height: 100%;
  width: 100%;
  padding: 0px;
  border-width: 0px;
  margin: 0px;
  left: 0px;
  top: 0px;
  touch-action: pan-x pan-y;
`;

const InnerContainer = styled.div`
  z-index: 4;
  position: absolute;
  left: 50%;
  top: 50%;
  width: 100%;
  transform: translate(0px, 0px);
`;

const Marker = styled.div`
  width: 42px;
  height: 64px;
  overflow: hidden;
  position: absolute;
  cursor: pointer;
  touch-action: none;
  user-select: none;
  border: 0px;
  padding: 0px;
  margin: 0px;
  max-width: none;
`;

const Home = () => {
  return (
    <Container>
      <InnerContainer>
        <div style={{ position: 'absolute', left: '0px', top: '0px', zIndex: 104, width: '100%' }}></div>
        <div style={{ position: 'absolute', left: '0px', top: '0px', zIndex: 105, width: '100%' }}></div>
        <div style={{ position: 'absolute', left: '0px', top: '0px', zIndex: 106, width: '100%' }}>
          <slot></slot>
          <span id="B9C6017C-7118-4608-A491-0BD6D66C8C55" style={{ display: 'none' }}>
            Pour naviguer, appuyez sur les touches fléchées.
          </span>

          {/* Exemple de marqueurs */}
          <Marker style={{ left: '78px', top: '-9px', zIndex: 55 }}>
            <img alt="" src="https://maps.gstatic.com/mapfiles/transparent.png" draggable="false" />
          </Marker>

          <Marker style={{ left: '34px', top: '-234px', zIndex: -170 }}>
            <img alt="" src="https://maps.gstatic.com/mapfiles/transparent.png" draggable="false" />
          </Marker>

          {/* Ajoutez d'autres marqueurs ici */}
        </div>
      </InnerContainer>
    </Container>
  );
};

export default Home;
